void time_bi_multiply(bigint *restrict const n1, bigint *restrict const n2)
{
	printf(" : Size %4" PRIdMAX "x%zub", n1->len, sizeof(*n1->num));

	const clock_t start = clock();

	bigint *const output = bi_multiply(n1, n2);

	const clock_t stop = clock();
	const double time_taken = (double)(stop - start) / CLOCKS_PER_SEC;

	if (!output)
		printf(" : FAILED");

	bi_delete(output);
	printf(" : %fs\n", time_taken);
}

